          ds.slot := position
      }
  }

  function setMinAge (uint256 _minAge) internal {
    StoreState storage storeState = diamondStorage();
    storeState.minAge = _minAge;
  }

  function getMinAge() internal view returns (uint256) {
    StoreState storage storeState = diamondStorage();
    return storeState.minAge;
